  const handleUpload = async (ocrText) => {
    setOCRResults(ocrText);
  };

  console.log(ocrResults);

  return (
    <div className="App">
      <div class="project-heading-container">
  <h2 class="project-heading">Extract ID Details</h2>
</div>
      <FileUpload onUpload={handleUpload} />
      <RecordsTable/>

    </div>
  );
}

export default App;
